import {
  Button,
  Grid
} from "@mui/material";

const TestGri= ()=>{
  const design = (
    <>
    <Grid>
      <Button xs="12" variant="contained" color='primary'>BUTTON-1</Button>
      <Button xs="12" variant="contained" color="secondary">BUTTON-2</Button>
      <Button xs="12" variant="contained" color="warning">BUTTON-3</Button>
    </Grid>
    </>
  );
  return design;
}
export default TestGri;
